import React, { Component } from 'react';
import { Switch, Route, Link } from 'react-router-dom'
import { BrowserRouter as Router } from 'react-router-dom';

import './policy-links.css';


class PolicyLinks extends Component {

  render() {

    return (
      <div className="policy-links__container">
        <Router>
          <Link to="/terms-of-service/" tabIndex='6'>Terms of Service</Link>
          <span className="pipe">|</span>
          <Link to="/privacy-policy/" tabIndex='7'>Privacy Policy</Link>
          <span className="pipe">|</span>
          <Link to="/cookie-policy/" tabIndex='8'>Cookie Policy</Link>
          <span className="pipe">|</span>
          <Link to="/security/" tabIndex='9'>Security</Link>
          <span className="pipe">|</span>
          <Switch>
            <Route path="/terms-of-service" />
            <Route path="/privacy-policy" />
            <Route path="/cookie-policy" />
            <Route path="/security" />
          </Switch>
        </Router>
        <div>Â© 2019 Circle Internet Services, Inc., All Rights Reserved.</div>
      </div>
    );
  } 
}


export default PolicyLinks;
